import React from "react";

const DiaryItem = ({ it }) => {
    return (
        <div className="DiaryItem">
            <div className="emotion_img_wrapper">
                <img src={process.env.PUBLIC_URL + `assets/emotion${it.emotion}.png`} />
            </div>
            <div></div>
            <div></div>
        </div>
    );
};

export default DiaryItem;
